script: |
  super -f text -I q12664.spq | sort > q12664.out

inputs:
  - name: q12664.spq
    data: |
      SELECT - ( + - col1 ) + - + 52 * - ( 22 ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT col0 + - col1 + - + col1 / 86 IS NULL OR col2 * col0 IS NOT NULL;
  - name: tab0

outputs:
  - name: q12664.out
    data: |
      1145
      1165
      1225
